import React from 'react';
import { AppBar, Toolbar } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

import "./header.css"

const Header = (props) => {

  return (
    <div class="header">
      <img className="logo" src={props.image}></img>
    </div>
  )


}


export default Header;
